import{_ as e,c as i,o as t,a4 as r,a5 as o,a6 as a}from"./chunks/framework.B_zElukG.js";const _=JSON.parse('{"title":"Joplin Search Integration","description":"","frontmatter":{},"headers":[],"relativePath":"zh-CN/joplin-search-integration/index.md","filePath":"zh-CN/joplin-search-integration/index.md"}'),n={name:"zh-CN/joplin-search-integration/index.md"},l=r('<h1 id="joplin-search-integration" tabindex="-1">Joplin Search Integration <a class="header-anchor" href="#joplin-search-integration" aria-label="Permalink to &quot;Joplin Search Integration&quot;">​</a></h1><p><a href="https://chrome.google.com/webstore/detail/joplin-search-integration/mcjkdcifkhjenpfjacnbhpdcnjknjkhj"><img src="https://user-images.githubusercontent.com/585534/107280622-91a8ea80-6a26-11eb-8d07-77c548b28665.png" alt="Get uBlock Origin for Chromium"></a> <a href="https://addons.mozilla.org/zh-CN/firefox/addon/joplin-search-integration/"><img src="https://user-images.githubusercontent.com/585534/107280546-7b9b2a00-6a26-11eb-8f9f-f95932f4bfec.png" alt="Get uBlock Origin for Firefox"></a></p><h2 id="简介" tabindex="-1">简介 <a class="header-anchor" href="#简介" aria-label="Permalink to &quot;简介&quot;">​</a></h2><p>使用搜索时，相关的乔普林笔记也会显示在搜索结果中。</p><p><img src="https://joplin-utils.rxliuli.com/images/joplin-search-integration-search.png" alt="search result"><img src="https://joplin-utils.rxliuli.com/images/joplin-search-integration-detail.png" alt="note preview"></p><p>目前支持的搜索引擎包括</p><ul><li>Google</li><li>Bing</li><li>Baidu</li><li>DuckDuckGo</li><li>Searx</li><li>MetaGer</li></ul><h2 id="常见问题" tabindex="-1">常见问题 <a class="header-anchor" href="#常见问题" aria-label="Permalink to &quot;常见问题&quot;">​</a></h2><h3 id="token-port-指的是什么-在哪儿可以找到" tabindex="-1">token/port 指的是什么，在哪儿可以找到？ <a class="header-anchor" href="#token-port-指的是什么-在哪儿可以找到" aria-label="Permalink to &quot;token/port 指的是什么，在哪儿可以找到？&quot;">​</a></h3><p>一般可以在 <strong>工具 &gt; 选项 &gt; 网页剪辑器</strong> 中看到</p><p><img src="https://img.rxliuli.com/20210316092547.png" alt="joplin web clipper"></p><h3 id="在-brave-浏览器中没有搜索结果" tabindex="-1">在 Brave 浏览器中没有搜索结果 <a class="header-anchor" href="#在-brave-浏览器中没有搜索结果" aria-label="Permalink to &quot;在 Brave 浏览器中没有搜索结果&quot;">​</a></h3><p>实际上是 Brave 会默认阻止其他域的资源，所以在 Google 搜索网站关闭它即可。</p><p><img src="https://img.rxliuli.com/20210320142144.png" alt="joplin web clipper"></p><h3 id="不能在这个网站上读取或修改数据" tabindex="-1">不能在这个网站上读取或修改数据 <a class="header-anchor" href="#不能在这个网站上读取或修改数据" aria-label="Permalink to &quot;不能在这个网站上读取或修改数据&quot;">​</a></h3><p>有时候安装完插件并且配置好后没有效果，查看插件显示为灰色的，提示无法在这个网站上读取或修改数据。</p><p>这时候需要手动配置为允许。</p><p><img src="'+o+'" alt="error"></p><p>Chrome</p><p><img src="'+a+'" alt="chrome"></p><p>Firefox</p><p><img src="'+a+'" alt="firefox"></p><h2 id="贡献" tabindex="-1">贡献 <a class="header-anchor" href="#贡献" aria-label="Permalink to &quot;贡献&quot;">​</a></h2><p>如果你希望添加新的搜索引擎支持，可以提出 issue，或者 fork 后修改提 PR（非常简单 ）</p><ol><li>在 manifest.json 添加匹配的搜索引擎的 url</li><li>实现 BaseSearchEngineAdapter 接口</li></ol>',25),p=[l];function s(c,h,d,g,m,u){return t(),i("div",null,p)}const b=e(n,[["render",s]]);export{_ as __pageData,b as default};
